import React, { Component } from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Login from './Pages/Login/Login';
class App extends Component {

  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route component={Login} path="/" exact />

        </Switch>
      </BrowserRouter>
    );
  }
}
export default App;
